import { useHistory } from "react-router-dom";
import IconButton from '@mui/material/IconButton';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';

const Arrows = () => {
    const history = useHistory();
    return (
        <div style={{ position: 'fixed', right: '6vw' }}>
            <IconButton color="primary" aria-label="upload picture" component="span" onClick={() => history.goBack()}>
                <ArrowBackIcon style={{ "backgroundColor": "#ffffff !important" }} />
            </IconButton>
            <IconButton color="primary" aria-label="upload picture" component="span" onClick={() => history.goForward()}>
                <ArrowForwardIcon style={{ "color": "#ffffff !important" }} />
            </IconButton>
        </div >
    );
}

export default Arrows;
